// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Admin.sol";
import "./Utils.sol";

contract RegulatoryAuthority {
    Admin public admin;
    mapping(address => bool) public isRegulatoryAuthority;

    event RegulatoryAuthorityRegistered(address indexed authority);
    event ComplianceRecorded(string entityId, string regulation, bool compliant);

    modifier onlyAdmin() {
        require(admin.isAdmin(msg.sender), "Only admin can call this function");
        _;
    }

    modifier onlyRegulatoryAuthority() {
        require(isRegulatoryAuthority[msg.sender], "Only registered regulatory authorities can call this function");
        _;
    }

    constructor(address _admin) {
        require(_admin != address(0), "Admin address cannot be zero");
        admin = Admin(_admin);
    }

    function registerRegulatoryAuthority(address _authority) external onlyAdmin {
        require(_authority != address(0), "Authority address cannot be zero");
        require(!isRegulatoryAuthority[_authority], "Authority already registered");
        isRegulatoryAuthority[_authority] = true;
        emit RegulatoryAuthorityRegistered(_authority);
    }

    function recordCompliance(string memory _entityId, string memory _regulation, bool _compliant) external onlyRegulatoryAuthority {
        admin.recordCompliance(_entityId, _regulation, _compliant);
        emit ComplianceRecorded(_entityId, _regulation, _compliant);
